/* eslint-disable react/prop-types */
import React from 'react';
import {
  ScrollView, View, Text, ImageBackground,
} from 'react-native';
import { TouchableOpacity } from 'react-native-gesture-handler';
import styles from './SearchListStyles';
import absalomBackground from '../../images/absalom-background.png';

function SearchList({ navigation }) {
  return (
    <ImageBackground source={absalomBackground} style={styles.backgroundImage}>
      <ScrollView style={styles.container}>
        <View style={styles.searchList}>
          <TouchableOpacity
            onPress={navigation.navigate('Character Detail')}
          >
            <Text>SearchList component</Text>
          </TouchableOpacity>
        </View>
      </ScrollView>
    </ImageBackground>
  );
}

export default SearchList;
